import './card.scss';

function Card(props) {
  return (
    <div className="card">
      <div className="imgBlock">
        <img className="dishImg" src={props.imgUrl} alt="dish" />
      </div>
      <div className="share">
        <img src="/img/share.svg" alt="share" />
      </div>
      <div className="titleBlock"></div>
    </div>
  );
}

export default Card;
